import React from 'react'
import { faReact } from "@fortawesome/free-brands-svg-icons";
import { faDatabase } from "@fortawesome/free-solid-svg-icons";
import { faJs } from "@fortawesome/free-brands-svg-icons";
import { faNpm } from "@fortawesome/free-brands-svg-icons";
import { faDigitalOcean } from "@fortawesome/free-brands-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../App.css';

export default function Skills() {
    return (
        <div>
            <section id = "Skills">
            <div class="grid-container"><center>   
                            <FontAwesomeIcon spin="true" color="black" size="5x" icon = {faReact}/>
                       
                            <FontAwesomeIcon color="black" size="5x" icon = {faDatabase}/>
                       
                            <FontAwesomeIcon color="black" size="5x" icon = {faJs}/>          
            </center> </div>
                <div className="row-center" style={{padding:"20px"}}>
                    <FontAwesomeIcon color="black" size="5x" icon = {faDigitalOcean}/>
                    <div className="Cicon">C#</div>
                    <FontAwesomeIcon color="black" size="5x" icon = {faNpm}/>
                </div>
            
                
                <br></br>
                <p>Skills</p>
                <p>Skills</p>
                <p>Skills</p>
                <p>Skills</p>
                <p>Skills</p>
                
            </section>
        </div>
    )
}
